         * Retrieves the session token.
         *
         * @return string
         */
        abstract protected function retrieveSessionToken() ;
        /**
         * Saves the session token so that it can be used by a later incarnation
         * of this class.
         *
         * @access private
         */
        abstract public function persistSessionToken() ;
    }

