     * that the form token is valid like this:
     *
     * <pre>
     * if ($dataHasBeenSubmitted && TYPO3\CMS\Core\FormProtection\FormProtectionFactory::get()
     * ->validateToken(
     * \TYPO3\CMS\Core\Utility\GeneralUtility::_POST('formToken'),
     * 'BE user setup', 'edit
     * )
