namespace TYPO3\CMS\Core\TypoScript\Parser {
    /**
     * The TypoScript parser
     */
    class TypoScriptParser {
        /**
         * TypoScript hierarchy being build during parsing.
         *
         * @var array
         */
        public $setup;
        /**
         * Raw data, the input string exploded by LF
         *
         * @var array
